import { Component } from '@angular/core';
import { FormGroup } from '@angular/forms';

@Component({
  selector: 'app-verify-login-otp',
  templateUrl: './verify-login-otp.component.html',
  styleUrls: ['./verify-login-otp.component.css']
})
export class VerifyLoginOtpComponent {
  formOtp:FormGroup;
  constructor(private _form){
    this.formOtp = this.forms.group({
      otp: this.forms.control("", Validators.compose([Validators.minLength(4), Validators.maxLength(4)])),
    })
  }
}
